import { useEffect, useState } from "react";
import "./style.css";
import { Link } from "react-router-dom";

function Navbar() {
  const [isSticky, setIsSticky] = useState(false);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");

  useEffect(() => {
    const handleScroll = () => {
      setIsSticky(window.scrollY > 0);
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <div className={`nav ${isSticky ? "sticky" : ""}`}>
      <div className="nav_container">
        <nav>
          <div className="nav_toggle" onClick={toggleDropdown}>
            <span className={`nav_toggle_icon ${isDropdownOpen ? "open" : ""}`}></span>
          </div>
          <ul className={`nav_menu ${isDropdownOpen ? "open" : ""}`}>
            <li>
              <Link to="/homes">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
        <form>
	<label for="search">Search</label>
	<input required="" pattern=".*\S.*" type="search" class="input" id="search"/>
	<span class="caret"></span>
</form>
      </div>
    </div>
  );
}

export default Navbar;
